export const REQUEST_SELECTED_ASSET = "REQUEST_SELECTED_ASSET";
export const RECEIVE_SELECTED_ASSET = "RECEIVE_SELECTED_ASSET";
export const CHECK_IN_SELECTED_ASSET = "CHECK_IN_SELECTED_ASSET";

export const requestSelectedAssetData = (assetID) => ({ 
    type: REQUEST_SELECTED_ASSET, assetID
});

export const receiveSelectedAssetData = (assetData) => ({
     type: RECEIVE_SELECTED_ASSET, assetData
});

export const checkInSelectedAsset = (assetID) => ({
    type: CHECK_IN_SELECTED_ASSET, assetID
});
